window.bookSummaryJSON = "<p><b>KORIV’N</b></p> <p>My mate’s scent calls to me. I hunt it, each step taking me closer to the one thing I came to Earth to find.</p> <p>These silly humans think they’ve captured me. What a joke. They’ve captured nothing! I’m here for my female, and nothing can stop me. I will find her, and I will claim her. She is mine!</p> <p>When my mate runs right into me and begs for me to take her away, I can hardly believe my ears. Today must be my lucky day!</p> <p><b>NIKKI</b></p> <p>I need to get out of here.</p> <p>With certain doom pounding at the door, I do the unthinkable: I beg the massively muscled mauve warrior towering over me to take me with him. To my surprise, the hunter gathers me into his arms, growls, “MINE!” and jumps out of a second-floor window!</p> <p>I hope this isn't a horrible mistake!</p>"; 
